import './App.css'; 
import React, { useEffect, useState } from "react";
import { BrowserRouter as Router } from "react-router-dom";
import RoutesConfig from "./routes/routes"; // Your React Router Config

// This will hold any data fetched from the backend
function App() {
  const [data, setData] = useState(null);

  // Fetch data from the backend API (example)
  useEffect(() => {
    // Assuming your backend is running at http://localhost:5000
    fetch('http://localhost:5000/api/data') // Adjust API endpoint as necessary
      .then(response => response.json())
      .then(data => setData(data.message)) // Assume the backend sends a message in response
      .catch(err => console.error('Error fetching data:', err));
  }, []);

  return (
    <Router>
      <div className="App">
        <h1>Welcome to Lawyer Website</h1>
        {/* Display the fetched data from the backend */}
        {data && <p>Backend Response: {data}</p>}

        {/* Frontend Routes Configuration */}
        <RoutesConfig />
      </div>
    </Router>
  );
}

export default App;
